// MINUS DROPDOWN
(function($){
	$.fn.extend({
		
		minusDropDown : function(options, callback){
			
			var defaults = {
				type: 'hover', //--> hover ve click parametrelerini alr
				customClass: 'hover', //--> holder ve attachmentDiv nesnesinin zerine gelince alaca class
				delay: 555, //--> type hover seildiinde mouseleave kullanlr 
				openedDelay: 0,//-->ilk alta geikme vermek iin kullanrz
				className: '', //--> type click seildiinde body tklannca divin kapanmas iin gerekli. gnderilmezse holdere atanm classlardan ilkini alr
				clicked: '', //-->tklanarak alacak ID yollanr, type click seilirse mutalaka gnderilmeli
				openedControl: '',
				hideDropDown: [], //-->bu zellik ile ak olan dier dropdownlar kapatabiliriz
				attachmentDiv: null
			};
			
			var options = $.extend(defaults, options);
			
			return this.each(function(){
				
				var holder = $(this), o = options, attachmentDiv = o.attachmentDiv != null ? $( o.attachmentDiv ) : null, className = '', stm = null;

				function init(){
					if( o.type == 'hover' ){
						
						holder.mouseenter( events.mouseenter ).mouseleave( events.mouseleave );
						
						if( attachmentDiv != null )
							attachmentDiv.mouseenter( events.mouseenter ).mouseleave( events.mouseleave );
					}
					else{ 
						$(o.clicked, holder).click( events.clicked );				
					}
					
					className = o.className != '' ? o.className : holder.context.className.split(' ')[ 0 ];
					$("body, html").click( events.bodyClicked );	
				}
				
				var animate = {
					opened: function(){ 
						
						controls(); 
						
						if( attachmentDiv != null )
							attachmentDiv.addClass( o.customClass );
						
						holder.addClass( o.customClass ); 
						
						if( callback != undefined ) callback('opened');
					},
					closed: function(){ 
	
						if( attachmentDiv != null )
							attachmentDiv.removeClass( o.customClass );
						
						holder.removeClass( o.customClass ); 
						
						if( callback != undefined ) callback('closed');
					}
				}
				
				var events = {
					mouseenter: function(){
						if( stm != null ) clearTimeout( stm );
						if( o.openedControl != '' ){
							var ID = o.openedControl;							
							if( ID.html() == '' ) return false;
						} 
						stm = setTimeout(function(){ animate.opened(); }, o.openedDelay);
					},
					mouseleave: function(){
						if( stm != null ) clearTimeout( stm );
						stm = setTimeout(function(){
							animate.closed();
						}, o.delay);
					}, 
					clicked: function(){ 
						if( holder.hasClass( o.customClass ) ) animate.closed();
						else animate.opened();  
					},
					bodyClicked: function( e ){
						if( holder.hasClass( o.customClass ) ){ 
							if( e.target.className != className && $( e.target ).parents( '.' + className ).size() != 1 ){ 
								animate.closed();	
							}
						}
					}
				}
				
				function controls(){
					if( o.hideDropDown.length > 0 ){
						for( var i = 0; i < o.hideDropDown.length;  ++i ){
							if( o.hideDropDown[i].length > 0 )
								o.hideDropDown[i][0].closed();
						}
					}
				}
				
				//PUBLIC FUNC
				this.opened = function(){ animate.opened(); }
				this.closed = function(){ if( stm != null ) clearTimeout( stm ); animate.closed();	}
				this.dispose = function(){ 
					if( o.type == 'hover' )	holder.unbind('mouseenter').unbind('mouseleave');
					else $(o.clicked, holder).unbind('click');				
				}
				this.live = function(){
					if( o.type == 'hover' )	holder.mouseenter( events.mouseenter ).mouseleave( events.mouseleave );
					else $(o.clicked, holder).click( events.clicked );			
				}		
	
				init();
			});
		}
	})
})(jQuery, window);

