(function($){
	$.fn.extend({
		
		minusPlayer : function(options, onReady, callback, onReadyStateChange){
			
			var defaults = {
				videoId: null,
				controls: 0,
				autoplay: 0,
				showinfo: 0,
				modestbranding: 1,
				rel: 0,
				color: 'white',
				hd: 1,
				playbackQuality: 'hd720',
				customClass: '',
				sound: 70,
				orientation: 'horizontal'
			};
			
			var options = $.extend(defaults, options);
			
			return this.each(function(){
				
				var o = options, div = $(this), holder, player = null, stm, orientation = o.orientation, firstMouseDown = 0, scrollerMouseDown = false, maxRate;

				function init(){
	
					if( o.videoId != null ){
					
						//--> html template
						div.html('<div class="youtubePlayer '+ o.customClass +'"><div class="videoWrapper"><div class="video"></div></div><div class="overlay"></div><div class="controllerWrapper"><div class="controller"><a href="javascript:void(0);" class="playPauseBtn"><span>play/pause</span></a><div class="progressBarWrapper"><div class="progressBar"><div class="total"></div><div class="progressVideoBytes"></div><div class="progressVideoTimes"></div><div class="tracker"></div></div></div><div class="time"></div><div class="sound"><a href="javascript:void(0);" class="soundBtn"><span>sound</span></a><div class="soundController"><div class="total"></div><div class="progress"></div><div class="tracker"></div></div></div><a href="javascript:void(0);" class="fullScreenBtn"><span>fullscreenbtn</span><i></i></a></div></div></div>');
						
						holder = $('.youtubePlayer', div);

						//--> Player
						player = new YT.Player( $('.videoWrapper .video', div)[0], {
							
							  height: '100%',
							  width: '100%',
							  videoId: o.videoId,
							  playerVars: {
									/*'controls': o.controls,
									
									'showinfo': o.showinfo,
									'modestbranding': o.modestbranding,*/
									'autoplay': o.autoplay,
									'rel': o.rel,
									'color': o.color,
									'hd': o.hd,
									'origin': ('https:' == document.location.protocol ? 'http://' : 'http://') + window.location.hostname + "/"
							  },
							  events: {
								'onError': onErrorHandler,
								'onReady': onPlayerReady,
								'onStateChange': onPlayerStateChange
							  }
							  
						});
					
					}
					
					//--> Controller
					$('.controller .playPauseBtn', div).bind('click', function(){
						if( player ){
							if( $('.youtubePlayer', div).hasClass('playing') ) player.pauseVideo();
							else player.playVideo();
						}
					});
					$('.controller .fullScreenBtn', div).bind('click', function(){
						fullScreenApi.requestFullScreen( $('.videoWrapper .video', div)[0] );
					});
					
					$('.controller .sound', div).minusDropDown();
				}
				
				init();				
				
				//PLAYER EVENT
				function onPlayerReady( evt ){

					evt.target.setPlaybackQuality( o.playbackQuality );
					
					playerUpdate();
					
					$('.progressBar', holder).click(function(event){
						if( player ){							
							var rate = ( event.pageX - $('.progressBar', holder).offset().left ) / $('.progressBar', holder).outerWidth( true );							
							player.seekTo( Math.floor( rate * player.getDuration() ), true );
						}
					});
					
					//SOUND CONTROLLER
					if( orientation == 'horizontal' ) tracking( o.sound );
					else tracking( 100 - o.sound );
					$('.sound .soundBtn', holder).bind('click', function(){ 
						if( $(this).hasClass('mute') ) tracking( o.sound );
						else{
							if( orientation == 'horizontal' ) tracking( 0 ); 
							else tracking( maxRate ); 
						}
					});      
                    $('.soundController', holder).bind('click', events.onClick);
					$('.soundController .tracker', holder).bind('mousedown', events.mousedown).bind('mouseup', events.mouseup);
					$(document).bind('mousemove', events.mousemove).bind('mouseup', events.mouseup);
					
					
					if( onReady != undefined ) onReady();
					
							
				}
				
				function onErrorHandler(){
					//alert('HATA...');
				}
				
				function onPlayerStateChange( evt ){					
					if( onReadyStateChange != undefined ) onReadyStateChange( evt );
				}
				
				function updatePlayer(){
					
					/*if( player ){
						
						//--> yklenen data miktar
						updateLoadProgress( ( parseFloat( player.getVideoBytesLoaded() ) / parseFloat( player.getVideoBytesTotal() ) ) * 100 ); 
						
						//--time progress
						updateTimeProgress( ( parseFloat( player.getCurrentTime() ) / parseFloat( player.getDuration() ) ) * 100 );
						
						//--> time format
						$('.controller .time', div).html( '<span class="currentTime">' + timeFormat( player.getCurrentTime() ) + '</span>' + '<span class="seperator">/</span><span class="getDuration">' + timeFormat( player.getDuration() ) + '</span>' );
					}*/
					
					
					getPlayerStateControl();
	
				}
				
				function getPlayerStateControl(){
					if( player ){
						
						var playerState = getPlayerState();
						
						if( playerState == 'buffering' ){
							//buffering  
						}else if( playerState == 'ended' ){
							
							IntervalClear();
							player.seekTo(0, true);
							setTimeout(function(){ player.pauseVideo(); playerUpdate(); }, 250);
						}else{
							if( playerState == "playing" ) $('.youtubePlayer', div).removeClass("paused").addClass("playing");
							else if( playerState == "paused" || playerState == 'video_cued' ) $('.youtubePlayer', div).removeClass('playing').addClass("paused");
						}
						
						if( callback != undefined ) 
							callback( playerState );
						
							
						div.trigger('playerState', [ playerState ]);
						
					}
				}
				
				function getPlayerState() {
					if( player ){
						var playerState = player.getPlayerState();
						switch( playerState ){
							case 5: return 'video_cued';
							case 3: return 'buffering';
							case 2: return 'paused';
							case 1: return 'playing';
							case 0: return 'ended';
							case -1: return 'unstarted';
							default: return 'Status_uncertain';
						}
					}
				}
				
				function updateLoadProgress( percent ){
					$('.progressBar .progressVideoBytes', holder).css({ 'width': percent + '%' });
				}
				
				function updateTimeProgress( percent ){
					$('.progressBar .progressVideoTimes', holder).css({ 'width': percent + '%' });
				}
				
				function timeFormat( time ){
					var str = '', t = time.toFixed();
					
					if( t < 60 ){
						if( t < 10 ) str = '0:0' + t;
						else str = '0:' + t;
					}else{
						var m = Math.floor( t / 60 ), s = ( t % 60 );
						if( s < 10 ) str = m + ':0' + s;
						else str = m + ':' + s;
					}
					
					return str;
				}
				
				//SOUND CONTROLLER
				var events = {
					mousedown: function( event ){
						if( orientation == 'horizontal' ) firstMouseDown = event.pageX - $('.soundController .tracker', holder).offset().left;
						else firstMouseDown = event.pageY - $('.soundController .tracker', holder).offset().top;
						scrollerMouseDown = true;
						
						return false;
					},
					mouseup: function(){
						scrollerMouseDown = false;
						return false;
					},
					mousemove: function( event ){
						if( scrollerMouseDown ){							
							var rate = 0;
							if( orientation == 'horizontal' ) rate = ( event.pageX - $('.soundController', holder).offset().left - firstMouseDown ) / $('.soundController', holder).outerWidth( true );
							else rate = ( event.pageY - $('.soundController', holder).offset().top - firstMouseDown ) / $('.soundController', holder).outerHeight( true );
							tracking( Math.floor(rate * 100 ) );
							
						}
						return false;
					}, 
					onClick: function( event ){
						var rate = 0;
						if( orientation == 'horizontal' ) rate = ( event.pageX - $('.soundController', holder).offset().left ) / $('.soundController', holder).outerWidth( true );
						else rate = ( event.pageY - $('.soundController', holder).offset().top ) / $('.soundController', holder).outerHeight( true );
						tracking( Math.floor(rate * 100 ) );
					}
				}

				function tracking( val ){
					
					var rate;
					
					if( orientation == 'horizontal' ){
						
						var scW = $('.soundController', holder).outerWidth( true ), sctW = $('.soundController .tracker', holder).outerWidth( true );
						
						if( val < 0 ) val = 0;
							
						rate = Math.floor( val / scW * scW );
						maxRate = 100 - Math.floor( sctW / scW * scW );

						if( rate <= maxRate ){ $('.soundController .tracker', holder).css({ 'left': rate + '%'  }); setSound( rate ); }
						else{ $('.soundController .tracker', holder).css({ 'left': maxRate + '%'  }); setSound( maxRate ); }
						
					}else{
						
						var scH = $('.soundController', holder).outerHeight( true ), sctH = $('.soundController .tracker', holder).outerHeight( true );
						
						if( val < 0 ) val = 0;
						
						rate = Math.floor( val / scH * scH ),
						maxRate = 100 - Math.floor( sctH / scH * scH );

						if( rate <= maxRate ){ $('.soundController .tracker', holder).css({ 'top': rate + '%'  }); setSound( rate ); }
						else{ $('.soundController .tracker', holder).css({ 'top': maxRate + '%'  }); setSound( maxRate ); }
						
					}
				}
				
				function setSound( val ){
					if( player ){
						
						val = isNaN( val ) ? o.sound : val;

						if( orientation == 'horizontal' )
							$('.soundController .progress', holder).css({ 'width': val + '%' });
						else{
							val = maxRate - val;
							$('.soundController .progress', holder).css({ 'height': val + '%' });
						}
					
						if( val <= 0 ) $('.sound .soundBtn', holder).addClass('mute');
						else $('.sound .soundBtn', holder).removeClass('mute');
						
						//player.setVolume( val );
						
						if( val > 0 ){
							if( orientation == 'horizontal' )
								o.sound = val;
							else
								o.sound = maxRate - val;
						}
					}
				}
				
				function IntervalClear(){
					if( stm != null ){
						clearInterval( stm );
						stm = null;
					}
				}
				
				function playerUpdate(){
					
					if( stm == null ){					
						stm = setInterval(updatePlayer, 1000);
						updatePlayer();			
					}
				};
				
				//GLOBAL FUNC
				this.seekTo = function( k ){
					if( typeof player.seekTo !== 'undefined' )
						player.seekTo(k, true);				
				};
				
				this.pauseVideo = function(){
					if( typeof player.pauseVideo !== 'undefined' )
						player.pauseVideo();					
				};
				
				this.stopVideo = function(){
					if( typeof player.stopVideo !== 'undefined' )
						player.stopVideo();					
				};
				
				this.playVideo = function(){
					
					if( typeof player.playVideo !== 'undefined' )    
						player.playVideo();
				};
				
				this.state = function(){
					return $('.youtubePlayer', div).hasClass('playing') ? true : false;
				};
				
				this.dispose = function(){
					if( stm != null ) clearTimeout( stm );
					stm = null;
					player = null;
					
					$('.controller .playPauseBtn', div).unbind('click');
					$('.controller .fullScreenBtn', div).unbind('click');
					$('.progressBar', holder).unbind('click');
					$('.sound .soundBtn', holder).unbind('click');
                    $('.soundController', holder).unbind('click', events.onClick);
					$('.soundController .tracker', holder).unbind('mousedown', events.mousedown).unbind('mouseup', events.mouseup);
					$(document).unbind('mousemove', events.mousemove).unbind('mouseup', events.mouseup);
				};

			});
		}
	})
})(jQuery, window);

